INSERT INTO `v1_cbf246f0eed7c256ff7e64edccdb5439fe3863ae6524d36080f1ce0777dfddfc` VALUES ("魔法防御力（ダウン不可）アップ", 92422340, "バトル開始時、すべてのモンスターの魔法防御力を中アップさせる。この効果は魔法防御力ダウンの影響を受けない。", "boss_magic_def_lower_limit", 1588);
INSERT INTO `v1_cbf246f0eed7c256ff7e64edccdb5439fe3863ae6524d36080f1ce0777dfddfc` VALUES ("ＴＰダウンカット", 92422340, "バトル開始時、すべてのモンスターがＴＰダウン\n100％カット状態になる。", "boss_tp_down_cut", 1589);
INSERT INTO `v1_cbf246f0eed7c256ff7e64edccdb5439fe3863ae6524d36080f1ce0777dfddfc` VALUES ("ダメージ減衰", 92422340, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 18, 1590);
INSERT INTO `v1_cbf246f0eed7c256ff7e64edccdb5439fe3863ae6524d36080f1ce0777dfddfc` VALUES ("ＴＰ上昇上限付与", 92422340, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 17, 1591);
INSERT INTO `v1_cbf246f0eed7c256ff7e64edccdb5439fe3863ae6524d36080f1ce0777dfddfc` VALUES ("ＨＰ吸収ダウン", 92422340, "バトル開始時、すべてのキャラのＨＰ吸収を中ダウンさせる。", 9, 1592);
INSERT INTO `v1_cbf246f0eed7c256ff7e64edccdb5439fe3863ae6524d36080f1ce0777dfddfc` VALUES ("ダメージカット", 92422340, "バトル開始時、すべてのモンスターがダメージ\n10％カット状態になる。", "boss_damage_cut", 1593);
